using Nethereum.ABI.FunctionEncoding.Attributes;
using Nethereum.Contracts;
using System.Collections.Generic;
using System.Numerics;

namespace TacticsWarMud.SystemDefinition
{
    public partial class BuySystemDeployment : BuySystemDeploymentBase
    {
        public BuySystemDeployment() : base(BYTECODE) { }
        public BuySystemDeployment(string byteCode) : base(byteCode) { }
    }

    public class BuySystemDeploymentBase : ContractDeploymentMessage
    {
        public static string BYTECODE = "";
        public BuySystemDeploymentBase() : base(BYTECODE) { }
        public BuySystemDeploymentBase(string byteCode) : base(byteCode) { }

    }

    public partial class CommitBuyFunction : CommitBuyFunctionBase { }

    [Function("tacticsWar__commitBuy")]
    public class CommitBuyFunctionBase : FunctionMessage
    {
        [Parameter("bytes32", "_commitHash", 1)]
        public virtual byte[] CommitHash { get; set; }
        [Parameter("bytes32", "_matchEntity", 2)]
        public virtual byte[] MatchEntity { get; set; }
    }

    public partial class RevealBuyFunction : RevealBuyFunctionBase { }

    [Function("tacticsWar__revealBuy")]
    public class RevealBuyFunctionBase : FunctionMessage
    {
        [Parameter("bytes32", "_matchEntity", 1)]
        public virtual byte[] MatchEntity { get; set; }
        [Parameter("uint256[]", "_pieceTypes", 2)]
        public virtual List<BigInteger> PieceTypes { get; set; }
        [Parameter("bytes32", "_secret", 3)]
        public virtual byte[] Secret { get; set; }
    }
}